import "./ListItem.css"

const ListItem = ({ todo }) => {
    return (
      <li className="todo-item">
        <input className="todo-item__checkbox" type="checkbox" />
        <div className="todo-item__todo">
          {todo}
        </div>
        <button className="todo-item__btn">Close</button>
      </li>
    );
  };
  export default ListItem;
